import React from 'react';
import styles from './ServiceMain.module.css';
import Services from '../Services/Services';
import repair from '../../../Assets/Images/repair.png';
import phone from '../../../Assets/Images/phone.jpg';
import transfer from '../../../Assets/Images/transfer.jpeg';
import cafe from '../../../Assets/Images/cafe.jpg';



const serviceMain = () => (
    <div className={styles.ServiceMain}>
        <h2>What you are Looking Today</h2>
        <div className={styles.Ext}>
            <div><Services img={repair} title='Phone Repair'/></div>
            <div><Services img={phone} title='Browse Phone'/></div>
            <div><Services img={transfer} title='Money Transfer'/></div>
            <div><Services img={cafe} title='Cyber Cafe'/></div>
        </div>
    </div>
)

export default serviceMain;
